function maxArrayValue(nums: number[]): number {
    while (nums.length > 1) {
        let maxSumIndex = 0;
        for (let i = 1; i < nums.length; i++) {
            if (nums[i - 1] <= nums[i]) {
                maxSumIndex = i;
                break;
            }
        }
        nums[maxSumIndex] += nums[maxSumIndex - 1];
        nums.splice(maxSumIndex - 1, 1);
    }
    return nums[0];
};
